import React from 'react';
import { Box, Card, Heading } from 'rebass'

const Post = ({ posts }) => {
  const post = posts.map((post, index) =>
    <Box key={post.id} className="post">
      <Card>
      <Heading>
        {post.title}
        </Heading>
      </Card>
    </Box>
  );

  return (
    <div>
      {post}
      </div>
  )
};

export default Post
